// Hero.js
import React from 'react';
import './App.css';

const Hero = () => {
  return (
    <div className="hero">
      <img 
        src="data:image/jpeg;base64," 
        alt="Autumn leaves background" 
        className="hero-bg"
      />
      <div className="hero-content">
        <h1 className="hero-title">OpenWeather</h1>
        <h2 className="hero-subtitle">
          Weather forecasts, nowcasts and history in a fast and elegant way
        </h2>
      </div>
    </div>
  );
};

export default Hero;